cordova.define("com.jiedaibao.hybridlog.HybridLog", function (require, exports, module) {
   var exec = require('cordova/exec');
   module.exports = {
       hybridLog : function(flag, message, successCallback, errorCallback) {
       exec(
            successCallback,
            errorCallback,
            'HybridLog',
            'hybridLog',
            [{
             "flag": flag,
             "message": message
             }]
            );
       }
    }
  }
);
